operations.content:
mutation AddMessage($email: String! @fromClaim(name: EMAIL), $name: String! @fromClaim(name: NAME), $message: String!) @rbac(requireMatchAll: [user]) {
  createOnemessages: db_createOnemessages(
    data: {message: $message, users: {connectOrCreate: {create: {name: $name, email: $email}, where: {email: $email}}}}
  ) {
    id
    message
  }
}

query AllUsers($email: String!) {
  findManyusers: db_findManyusers(where: {email: {equals: $email}}) {
    id
    email
    name
    messages(take: 5, orderBy: [{id: desc}]) {
      id
      message
    }
  }
}

mutation ChangeUserName($newName: String!, $email: String! @fromClaim(name: EMAIL), $updatedAt: DateTime! @injectCurrentDateTime) {
  updateOneusers: db_updateOneusers(
    data: {name: {set: $newName}, updatedat: {set: $updatedAt}}
    where: {email: $email}
  ) {
    id
    email
    name
    updatedat
  }
}

query Countries {
  countries_countries {
    code
    name
    phone
    capital
  }
}

mutation DeleteAllMessagesByUserEmail($email: String!) @rbac(requireMatchAll: [superadmin]) {
  deleteManymessages: db_deleteManymessages(
    where: {users: {is: {email: {equals: $email}}}}
  ) {
    count
  }
}

query Messages {
  findManymessages: db_findManymessages(take: 20, orderBy: [{id: desc}]) {
    id
    message
    users {
      id
      name
    }
  }
}

query MockQuery {
  findFirstusers: db_findFirstusers {
    id
    email
    name
  }
}

query Query {
  db_findManyusers {
    id
    name
    germanyCode: _join {
      countries_country(code: "DE") {
        code
      }
    }
  }
}

mutation SetLastLogin($email: String!, $now: DateTime! @injectCurrentDateTime) @internalOperation {
  updateOneusers: db_updateOneusers(
    where: {email: $email}
    data: {lastlogin: {set: $now}}
  ) {
    id
    lastlogin
  }
}

mutation UpdateUser($id: Int!, $create: db_usersCreateInput!, $update: db_usersUpdateInput!) {
  db_upsertOneusers(where: {id: $id}, create: $create, update: $update) {
    id
    name
    email
  }
}

query UserInfo($email: String! @fromClaim(name: EMAIL)) {
  findFirstusers: db_findFirstusers(where: {email: {equals: $email}}) {
    id
    email
    name
    lastlogin
  }
}

